import './App.css';
import ParlayForm from './ParlayForm';
import Report from './Report';
import { useState } from 'react';
import { seedBasic } from './api';

function App() {
  const [tab, setTab] = useState('parlays');

  return (
    <div style={{ maxWidth: 960, margin: '0 auto', padding: 16, display: 'grid', gap: 16 }}>
      <h1>NBA Parlay Tracker</h1>
      <div style={{ display: 'flex', gap: 8 }}>
        <button onClick={() => setTab('parlays')} disabled={tab === 'parlays'}>Manage Parlays</button>
        <button onClick={() => setTab('report')} disabled={tab === 'report'}>Report</button>
        <button onClick={async () => { await seedBasic(); alert('Seeded teams/players'); }}>Seed Teams/Players</button>
      </div>
      {tab === 'parlays' ? <ParlayForm /> : <Report />}
    </div>
  );
}

export default App;
